import PropTypes from 'prop-types';

function Header({ text, bgColor }) {
  const headerStyles = { 
    backgroundColor: 'blue', 
    color: 'red' 
   };

  return (
    <header style={headerStyles}>
      <div className="container">
        <h2>{text}</h2>
      </div>
    </header>
  );
}

Header.defaultProps = {
  text: 'Feedback UI',
};

Header.propTypes = {
  text: PropTypes.string.isRequired,
};

export default Header;
